import "./App.css";
// import bar from "../src/img/Progress-Loading/512x512.gif";

function App() {
  return (
    <div className="app-container">
      <div>
        <img src="https://influencex-profile-pictures.nyc3.cdn.digitaloceanspaces.com/themes/CarnivalTop.png" alt="" />
      </div>
      <div>
        <img src="https://influencex-profile-pictures.nyc3.cdn.digitaloceanspaces.com/themes/CarnivalBottom.webp" alt="" />
      </div>
      <div className="wheel">
        <img
          src="https://games.engagebud.com/static/media/wheelimage.67aed50ccb8573880d27.webp"
          alt="wheel-img"
        />
      </div>
      <div className="info">
        <input type="Your Email Here" />
        <button>Try your luck</button>
        <div className="progress">
          <div className="fill a"></div>
        </div>
      </div>
    </div>
  );
}

export default App;
